            positiveXValues: [],
            timeYValues: [],
        }
    }

    render() {
        return (
            <div className="App">
            <header className="App-header">
            </header>
            <h3>Data</h3>
            <Table></Table>
            <Chart
            title = {this.state.title}
            positiveXValues = {this.state.positiveXValues}
            timeYValues = {this.state.timeYValues}
            ></Chart>
          </div>
        )
    }
